>     // always create a NodeArg for graph input in case its from an initializer
>     GetOrCreateNodeArg(graph_input.name(), &graph_input.type());
>   }
> }
> ```

Thanks for quick action! This bug blocked tf2onnx upgrade to IR version 4.
